import React from 'react';
import './footer.css';


class Footer extends React.Component {
    render() {
        return(
            <React.Fragment>
                <div className='footer'>
                    <div className='content has-text-centered subtitle is-3'>Copyright 2020</div>
                </div>
            </React.Fragment>
        )
    }
}

export default Footer;
